import { useState } from "react";
import Dropdown from "./Dropdown";
import YouTubeEmbed from "./YouTubeEmbed";

function Dropdown2({ children, name, positions, moves, style }) {
  const [dropdown, setDropdown] = useState(false);

  const validPositions = positions.filter((position) =>
    moves.some((move) => move.position === position)
  );

  return (
    <div className="dropdown">
      <button className="dropdown-btn" onClick={() => setDropdown(!dropdown)}>
        {name}
      </button>
      {dropdown &&
        positions.map((position, index) => {
          console.log(validPositions);
          validPositions.map((position) => {
            <Dropdown name={position} key={index}>
              {moves
                .filter((move) => move.position === position)
                .map((move) => (
                  <div className="youtube-embed" key={move.id}>
                    <YouTubeEmbed videoId={move.id} />
                  </div>
                ))}
            </Dropdown>;
          });
        })}
    </div>
  );
}

export default Dropdown2;
